import 'Data.dart';class AddCategoryResponse {  AddCategoryResponse({      this.status,       this.message,       this.data,  });  AddCategoryResponse.fromJson(dynamic json) {    status = json['status'];    message = json['message'];    data = json['data'] != null ? CategoryData.fromJson(json['data']) : null;  }  int ?status;  String ?message;  CategoryData? data;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['status'] = status;    map['message'] = message;    if (data != null) {      map['data'] = data!.toJson();    }    return map;  }}